import React from 'react';

import NewsContainer from './NewsContainer'
import NewsCard from './NewsCardShort';

class NewsPage extends React.Component {
    showOneNews(id) {
        // console.log('HUUUUUUUUUUUUUUUUUUUUUUUUUUUIIIIIIIIIIIIIIIIIII!!!!!')
        this.props.history.push(`/news/` + id);
    }
    render(){
        return(
        <div className="container">
                              <button type="button" class="btn btn-primary" onClick={() => this.showOneNews(1)}>Read</button>
            <div className="row">
                <div className="col-1"></div>
                <div className="col-10">
                    <div className="input-group mb-3 w-100 my-3">
                        <input type="text" className="form-control" placeholder="Author's name" aria-describedby="button-addon2"/>
                        <div className="input-group-append">
                            <button className="btn btn-outline-primary" type="button" id="button-addon2">Search</button>
                        </div>
                    </div>
                    <NewsContainer/>
                </div>
                <div className="col-1"></div>
            </div>
        </div>
  
        );
    }
}

export default NewsPage
